    footer{margin-top:28px;color:var(--muted);font-size:13px;text-align:center}

      <div>
        <h1>Album musik Roblox All Map — KAYZEN0276</h1>
        <p class="lead">Kumpulan track / audio Roblox. Klik "Buka" untuk melihat item di Roblox Library atau "Salin ID" untuk menyalin asset ID.</p>
        <div class="controls">
          <input id="search" type="search" placeholder="Cari judul atau ID..." />
          <button id="clear">Bersihkan</button>
        </div>
      </div>
    </header>

    <main>
      <div id="list" class="track-list"></div>
    </main>

    <footer>
      Jangan lup follow tiktok ku ya😊.
    </footer>
  </div>

  <script>
    const tracks = [
      {id: '102375459192743', title: 'sesuatu yang sempurna'},
      {id: '115839343339160', title: 'dangdut'},
      {id: '122665842844850', title: 'Cikampek Tasik Malaya'},
      {id: '104207837699519', title: 'tabola bale'},
      {id: '77533933904801', title: 'coba coba'},
      {id: '96077163288111', title: 'jika tidak hari ini'},
      {id: '106291412410472', title: 'DJ kangen banget'},
      {id: '110524647114903', title: 'Galau'},
      {id: '89610760702249', title: 'stereo love'},
      {id: '70734926325783', title: 'die with a smile'},
      {id: '16662832435', title: 'DJ indo panjang'},
      {id: '73922038429555', title: 'DJ APT'},
      {id: '85427648559465', title: 'DJ phut HoN indo'},
      {id: '122389825417820', title: 'Untitled'},
      {id: '99177939207931', title: 'soa soa'},
      {id: '118080982710004', title: 'Satu malam saja'},
      {id: '84272432192031', title: 'mejikuhibiniu'},
      {id: '120923889844823', title: 'aku suka nonton sound horeg'}
    ];

    const listEl = document.getElementById('list');
    const searchEl = document.getElementById('search');
    const clearBtn = document.getElementById('clear');

    function makeTrackCard(t){
      const div = document.createElement('div'); div.className='track';
      const h = document.createElement('h3'); h.textContent = t.title; div.appendChild(h);
      const meta = document.createElement('div'); meta.className='meta';
      const idspan = document.createElement('span'); idspan.textContent = t.id; meta.appendChild(idspan);
      const provider = document.createElement('span'); provider.textContent = 'Roblox Library'; provider.style.opacity=0.8; meta.appendChild(provider);
      div.appendChild(meta);

      const btns = document.createElement('div'); btns.className='buttons';

      const open = document.createElement('a');
      open.className='link-btn';
      open.textContent='Buka';
      open.target='_blank';
      open.rel='noopener';
      open.href = `https://www.roblox.com/library/${t.id}`;

      const copy = document.createElement('button');
      copy.textContent='Salin ID';
      copy.addEventListener('click',()=>{
        navigator.clipboard.writeText(t.id).then(()=>{
          copy.textContent='Tersalin!';
          setTimeout(()=>copy.textContent='Salin ID',900);
        }).catch(()=>{
          alert('Gagal menyalin. Silakan salin manual: ' + t.id);
        });
      });

      btns.appendChild(open);
      btns.appendChild(copy);
      div.appendChild(btns);
      return div;
    }

    function render(filter=''){
      listEl.innerHTML='';
      const q = filter.trim().toLowerCase();
      const filtered = tracks.filter(t=> t.title.toLowerCase().includes(q) || t.id.includes(q));
      if(filtered.length===0){
        listEl.innerHTML = '<div style="color:var(--muted);padding:12px;border-radius:8px;background:rgba(255,255,255,0.01)">Tidak ada hasil.</div>';
        return;
      }
      filtered.forEach(t=> listEl.appendChild(makeTrackCard(t)));
    }

    searchEl.addEventListener('input',(e)=> render(e.target.value));
    clearBtn.addEventListener('click',()=>{searchEl.value='';render('');});

    render('');
  </script>
